How to use calcuted date in a mongodb filter?<p>I want to filter for documents that are within the last minute. But the following query, with a calculated <code>$gte</code> time, does not work.</p>

<pre><code>db.mycollection.aggregate([
    {$match: {
       "properties.time": {$gte: {$subtract: [ISODate(), 60000]}}
    }}
])
</code></pre>

<p>It doesn't return anything, but not because there are no dates within the last minute. As far I can tell from projecting the calculated date in queries that do work, the calculated date is correct. Is there some reason that you cannot use a calculated value in this way?</p>

<p>The following query, with a hard-coded time, does work:</p>

<pre><code>db.mycollection.aggregate([
    {$match: {
       "properties.time": {$gte: ISODate("2018-12-26T12:00:00Z")}
    }}
])
</code></pre>

<p>I also considered calculating the age in seconds and then filtering based on that. The following also does work.</p>

<pre><code>db.mycollection.aggregate([
    {$project: {
        "properties.time": "$properties.time",
        "age": {$subtract: [ISODate(), "$properties.time"]}
    }},
    {$match: {
        "age": {$lte: 60000}
    }}
])
</code></pre>

<p>But that's not a good solution because</p>

<ul>
<li><p>really, I want to include the filter in a <code>$geoNear</code> query, and since <code>$geoNear</code> has to be the first step in the pipeline, I can't project the age and then use it in the <code>$geoNear</code></p></li>
<li><p>I want to use the index on <code>"properties.time"</code></p></li>
</ul>

<p>We're using eve, so another workaround would be to convert the requested <code>max_age</code> parameter to a <code>start_time</code> in a hook. But it really seems like that first approach should work.</p>

