Aggregate multiple arrays by field value<p>With a document as shown below, I am trying to aggregate the data so my final output is the sum of each users <code>received</code> and <code>sent</code> values.</p>

<p><strong>Document</strong></p>

<pre><code>{
    "_id" : 1,
    "received" : [
        { "name" : "david", "value" : 15 }, 
        { "name" : "sarah", "value" : 10 }, 
        { "name" : "sarah", "value" : 15 }
    ],
    "sent" : [ 
        { "name" : "david", "value" : 10 }, 
        { "name" : "sarah", "value" : 20 }, 
        { "name" : "david", "value" : 15 }
    ]
}
</code></pre>

<p><strong>Desired Result (or similar)</strong></p>

<pre><code>{
    "name": "david",
    "received": 15,
    "sent": 25
},
{
    "name": "sarah",
    "received": 25,
    "sent": 20
}
</code></pre>

<p>I have tried to unwind received and sent, but I am ending up with a lot of duplicates and honestly I have no idea if this sort of output can even be created without bringing the dataset into my client first.</p>

<p>Further searching of StackOverflow has lead me to <a href="https://stackoverflow.com/questions/52978790/mongodb-aggregate-multiple-arrays">mongodb aggregate multiple arrays</a> that provides a suitable answer. I have flagged this as a duplicate.</p>

<p><strong>My final solution, created by following the above post, is as follows;</strong></p>

<pre><code>[
  {
    '$addFields': {
      'received.type': 'received', 
      'sent.type': 'sent'
    }
  }, {
    '$project': {
      'movements': {
        '$concatArrays': [
          '$received', '$sent'
        ]
      }
    }
  }, {
    '$unwind': {
      'path': '$movements'
    }
  }, {
    '$project': {
      'name': '$movements.name', 
      'type': '$movements.type', 
      'value': '$movements.value'
    }
  }, {
    '$group': {
      '_id': '$name', 
      'sent': {
        '$sum': {
          '$cond': {
            'if': {
              '$eq': [
                '$type', 'sent'
              ]
            }, 
            'then': '$value', 
            'else': 0
          }
        }
      }, 
      'received': {
        '$sum': {
          '$cond': {
            'if': {
              '$eq': [
                '$type', 'received'
              ]
            }, 
            'then': '$value', 
            'else': 0
          }
        }
      }
    }
  }
]
</code></pre>

