<p>Is it possible with <code>MongoDB aggregation</code> (or other feature) and how?</p>

<pre><code>{
    "_id" : NumberLong(409),
    "Parsed" : {
            "FileId" : "421462559",
            "MessageId": "123",
            "Fields" : [
                    {
                            "SchemaName" : "xxx",
